        $this->addSql("INSERT INTO `page` (`id`, `name`, `title`, `content`, `type`, `path`, `publication_date`, `persistent`, `meta_title`, `meta_description`, `meta_keywords`, `created_at`, `updated_at`, `enabled`) VALUES (1,NULL,'Hola mundo','Hola amigos.\n\nNuestra más humilde bienvenida a nuestro blog.\n\nEn este blog encontrarás las últimas novedades, así como todas las noticias relacionadas con nuestra tienda.\n\nNo dudéis en dejar vuestros comentarios e impresiones, así como sugerencias y opiniones. Éstos nos serán de extrema ayuda para mejorar nuestro producto y poder seguir trabajando para darle un mejor servicio cada dia.\n\nSalutaciones y esperamos verle de nuevo.',2,'hola-mundo',NOW(),0,NULL,NULL,NULL,NOW(),NOW(),1), (2,NULL,'Sobre nosotros','Sobre nosotros',1,'sobre-nosotros',NOW(),0,'Sobre nosotros','Sobre nosotros','sobre,nosotros',NOW(),NOW(),1), (3,NULL,'Términos y condiciones','Términos y condiciones',1,'terminos-y-condiciones',NOW(),0,'Términos y condiciones','Términos y condiciones','términos,condiciones',NOW(),NOW(),1), (4,'order_confirmation','Confirmación de pedido','Pedido confirmado para {{ customer.fullname }}.',3,NULL,NOW(),1,NULL,NULL,NULL,NOW(),NOW(),1), (5,'order_shipped','Aviso de envío de pedido para el cliente','Hola {{ customer.fullname }}. Su pedido acaba de ser mandado.',3,NULL,NOW(),1,NULL,NULL,NULL,NOW(),NOW(),1), (6,'customer_registration','Confirmación de registro','Bienvenido {{ customer.fullname }},<br/><br/>\n\nTu cuenta se ha creado correctamente.<br/>\nDeseamos que en nuestra tienda encuentres productos de tu agrado y que el proceso de compra te resulte lo más cómodo posible.<br/><br/>\n\nAtentamente,',3,NULL,NOW(),1,NULL,NULL,NULL,NOW(),NOW(),1), (7,'password_remember','Recordatorio de contraseña','Hola {{ customer.fullname }}. Para recuperar tu contraseña entra en <a href=\"{{ remember_url }}\">este enlace</a>.',3,NULL,NOW(),1,NULL,NULL,NULL,NOW(),NOW(),1), (8,'password_recover','Contraseña recuperada','Hola {{ customer.fullname }}. Tu contraseña ha sido recuperada.',3,NULL,NOW(),1,NULL,NULL,NULL,NOW(),NOW(),1)");
